import './App.css';

function Final(props) {

    let team = props.team;
    let position = props.position;
    let circuit = props.circuit;

    return (
    <div>
        <h1>{team} finished at position {position} in {circuit} circuit.</h1>
    </div>
  );
}

export default Final;
